import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import userNotes from "../userNotes";

function appContent() {
  return ( <div> <Header/> <body>
    {userNotes.map(contact => ( <
      Note key = {
        contact.id
      }
      title = {
        contact.title
      }
      content = {
        contact.content
      }
      / >
    ))}
    </body > <Footer/> </div>);
  }

  export default appContent;
